  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0143942 includes discrete
  sample and profile data collected from FRANKLIN in the Indian Ocean from 1996-05-07
  to 1996-05-31. These data include DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE,
  SALINITY, WATER TEMPERATURE, phosphate and silicate. The instruments used to collect
  these data include CTD and bottle.nnThese data were collected by Peter McIntosh
  of Commonwealth Scientific and Industrial Research Organization as part of the WOCE_ISS03_09FA19960507
  data set. CDIAC associated the following cruise ID(s) with this data set: FR05/96
  and WOCE_ISS03_1996nnThe World Ocean Circulation Experiment (WOCE) was a major component
  of the World Climate Research Program with the overall goal of better understanding
  the ocean's role in climate and climatic changes resulting from both natural and
  anthropogenic causes. The CO2 survey took advantage of the sampling opportunities
  provided by the WOCE Hydrographic Program (WHP) cruises during this period between
  1990 and 1998. The final collection covers approximately 23,000 stations from 94
  WOCE cruises.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
